data.value:
-- Step 1: Count steps per status per task WITH StepCounts AS ( SELECT UTS.taskId, UTS.taskStatusId, COUNT(*) AS StepCount FROM AD.UserTaskSteps UTS GROUP BY UTS.taskId, UTS.taskStatusId ),
-- Step 2: Total steps per task TotalSteps AS ( SELECT taskId, SUM(StepCount) AS TotalSteps FROM StepCounts GROUP BY taskId )
-- Step 3: Calculate percentage and assign color per status SELECT SC.taskId, COALESCE(TS.taskStatusName, 'Blank') AS StatusName, CASE WHEN TS.taskStatusName IS NULL THEN '' ELSE TS.taskStatusName END AS LabelName, SC.StepCount, TS2.TotalSteps, CAST(SC.StepCount * 100.0 / TS2.TotalSteps AS DECIMAL(5,2)) AS Percentage, CASE TS.taskStatusName WHEN 'Assigned' THEN '#007bff' -- Blue WHEN 'Completed' THEN '#28a745' -- Green WHEN 'Confirmed' THEN '#20c997' -- Darker Green WHEN 'Hold' THEN '#ffc107' -- Orange/Yellow WHEN 'Not Confirmed' THEN '#6c757d' -- Gray WHEN 'Postponed' THEN '#795548' -- Brown WHEN 'Pending' THEN '#dc3545' -- Red WHEN 'In-Process' THEN '#6610f2' -- Purple WHEN 'Close' THEN '#343a40' -- Dark Gray / Almost Black WHEN 'Cancelled' THEN '#dc3545' -- Red ELSE '#f8f9fa' -- Light Gray for blank/others END AS ColorHex FROM StepCounts SC INNER JOIN TotalSteps TS2 ON SC.taskId = TS2.taskId LEFT JOIN AD.TaskStatus TS ON SC.taskStatusId = TS.taskStatusId ORDER BY SC.taskId, StatusName;
